let cookiesList = [];

cookiesList.push({
    "image":"C:\Users\Ibrahim\Desktop\react_week1\react_shop_page2\react_shop_page2\src\cookies.jpg",
    "name": "Mini Chocolate",
    "price": "1.5"
},{
    "image":"C:\Users\Ibrahim\Desktop\react_week1\react_shop_page2\react_shop_page2\src\cookies.jpg",
    "name": "Large Chocolate",
    "price": "2.5"
})


function Cookies(cookies) {
    return ( 
        <div className="App">
      <header className="App-header">
        <div className = "cookiesList">
            {cookies => cookies.map(cookie => <div className = "cookie">
                <img src={cookie.image}></img>
                <h3>{cookie.name}</h3>
                <p>{cookie.price} K.D.</p>
            </div>)}
        </div>
      </header>
    </div>
  );
}

let currentList = Cookies(cookiesList);
console.log(cookiesList.map(cookie => `${cookie.price} K.D.`))
console.log(cookiesList)
export default currentList;
